  \"relative-abundance-and-distribution-of-geese-swans-and-sandhill-cranes-on-the-yukon-delta\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 1985, the Fish and Wildlife Service
  began development of an aerial breeding pair survey to estimate populations and
  determine distribution of geese nesting in the coastal zone of the Yukon Delta National
  Wildlife Refuge. The results of the population aspect of this study have been reported
  in threeprogress reports (Butler and Malecki 1986, Butler et al. 1987 and 1988).
  Preliminary distribution maps were presented in the first progress report (Butler
  and Malecki 1986). This progress report presents updated relative abundance and
  distribution maps based on three years of survey data.\",\n\t\"license_title\":
